import {useSelector} from 'react-redux';
import '../redux/store';

function dictTemplate(flagD, buttonLanguageTextD, discoveryD, ticketsD, homeD, qrCodeD, informationsD, loginD, languageD, logoutD) {
    return {
        flagD,
        buttonLanguageTextD,
        mainTitleD: 'Paris 2024',
        componentsD: [discoveryD, ticketsD, homeD, qrCodeD, informationsD],
        componentsNameD: ['discovery', 'tickets', 'home', 'qrcode', 'informations'],
        discoveryD,
        ticketsD,
        homeD,
        qrCodeD,
        informationsD,
        loginD,
        languageD,
        logoutD,
        // (Text data is omitted for brevity ...)
    };
}

function Translations() {
    const language = useSelector(state => state.language);
    const dictFrench = dictTemplate(
        'https://www.svgrepo.com/show/365915/france.svg',
        'Anglais',
        'Découverte',
        'Billets',
        'Accueil',
        'QR Code',
        'Informations',
        'Connexion',
        'Fr',
        'Déconnexion'
    );
    const dictEnglish = dictTemplate(
        'https://www.svgrepo.com/show/365950/usa.svg',
        'Español',
        'Discovery',
        'Tickets',
        'Home',
        'QrCode',
        'Informations',
        'Login',
        'En',
        'Logout'
    );

    // Rest of the code...
}
